import React, { Component } from "react";
import styled from "styled-components";

class SignIn extends Component {
  render() {
    return;
  }
}

const Account = styled.div`
  width: 100vw;
  height: auto;
  padding: 20px 35px 5px 35px;
  margin-top: 1rem;
  position: relative;
  background: linear-gradient(
    94deg,
    rgba(60, 52, 107, 1),
    rgba(44, 72, 107, 1)
  );
`;

export default SignIn;
